import React from 'react';

class Home extends React.Component {
  state = {
    topScorers: [
      {
        name: 'Joe Bloggs',
        goals: 0
      },
      {
        name: 'Lionel Messi',
        goals: 5
      },
      {
        name: 'Neil Dewing',
        goals: 19
      }
    ]
  };

  render() {
    const topScorers = this.state.topScorers.map(scorer => {
      <p>{scorer.name}</p>;
    });
    return (
      <>
        <h1>FootyScores</h1>
        <hr />
        <h2>Top Scorers</h2>
        {this.topScorers}
        <hr />
        <h2>Previous Result</h2>
        <hr />
        <h2>Next Match</h2>
      </>
    );
  }
}

export default Home;
